import React, {Component} from 'react';
import axios from 'axios';
import './App.css';

class App extends Component {

    componentWillMount() {
        this.setState({
            show: false
        })
    }

    onClick = async () => {
        const response = await axios.get('http://localhost:8080/shortestPath/maxDistance/C/C/30');
        console.log(response);
        this.setState({
            items: response.data,
            show: true
        })
    }

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <h2>Welcome to ThoughtWorks Train Manage System!</h2>
                </header>
                <main>
                    <div className="App-grid-container">
                        <div className="App-exact-path">1</div>
                        <div className="App-condition-stops">2</div>
                        <div className="App-result">3</div>
                        <div className="App-condition-distance">4</div>
                        <div className="App-shortest-path">5</div>
                    </div>
                </main>
                <footer className="App-footer">
                    All rights reserved by ThoughtWorks.
                </footer>
            </div>
        );
    }
}

export default App;
